PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE menus_items
                                (id INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
                                title VARCHAR(255) NOT NULL,
                                description TEXT,
                                price FLOAT,
                                menu_id INT NOT NULL,
                                res_id INT NOT NULL,
                                FOREIGN KEY (menu_id, res_id) REFERENCES menus (id, res_id)
                                );
COMMIT;
