INSERT INTO menus_items VALUES(623,'Whopper Meal','Our Whopper Sandwich is a 1/4 lb* of savory flame-grilled beef topped with juicy tomatoes, fresh lettuce, creamy mayonnaise, ketchup, crunchy pickles, and sliced white onions on a soft sesame seed bun. Meal comes in medium and large sizes with a side of piping hot, thick cut French Fries and a fountain drink of your choice to make it a meal.*Based on pre-cooked patty weight.',8.580000000000000071,3,2046111);
