INSERT INTO menus_items VALUES(1436,'Sonic Cheeseburger','What you see is what you get. Melty American cheese, crinkle-cut pickles, chopped onions, fresh shredded lettuce & ripe tomatoes on a perfectly seasoned, 100% pure beef patty with your choice of mustard, mayo or ketchup. Straightforward and tasty, just the way it should be.',4.9900000000000002131,1,1750104);
INSERT INTO menus_items VALUES(1437,'Super Sonic Double Cheeseburger','Double the SONIC® goodness with the SuperSONIC® Cheeseburger. Two perfectly seasoned 100% pure beef patties layered with crinkle-cut pickles, chopped onions, fresh shredded lettuce & ripe tomatoes with your choice of mustard, mayo or ketchup. Seeing double has never been tastier.',6.6900000000000003907,1,1750104);
INSERT INTO menus_items VALUES(1438,'Super Sonic Bacon Double Cheeseburger','Bacon makes everything better - especially when it''s as good as our SuperSONIC® Double Cheeseburger. We start with two quarter-pound, 100% pure beef hamburgers, two melty slices of American cheese, lettuce, fresh sliced tomatoes, creamy mayo, and top it all off with crispy bacon.',7.3899999999999996802,1,1750104);
INSERT INTO menus_items VALUES(1439,'Sonic Bacon Cheeseburger','Bacon makes everything better - especially when it''s as good as our SONIC® Cheeseburger. We start with one quarter-pound, 100% pure beef hamburger, slice of American cheese, lettuce, fresh sliced tomatoes, creamy mayo, and top it all off with crispy bacon.',5.8899999999999996802,1,1750104);
INSERT INTO menus_items VALUES(1440,'Footlong 1/4 lb. Coney','Want something filling that''s also a great deal? Try SONIC''s Footlong Quarter Pound Coney. A grilled hot dog (contains pork and beef) topped with warm chili and melty cheddar cheese served in a soft, warm bakery bun',4.9900000000000002131,1,1750104);
INSERT INTO menus_items VALUES(1441,'Premium 100% All Beef Hot Dog All American Dog','Take a bite out of Americana with SONIC''s Premium Beef All-American Dog. It''s a beef hot dog made with 100% pure beef that''s grilled to perfection and topped with ketchup, yellow mustard, relish and chopped onions and served in a soft, warm bakery bun.',2.4900000000000002131,1,1750104);
INSERT INTO menus_items VALUES(1442,'100% All Beef Regular Chili Cheese Coney 6 inch','Want something filling that''s also a great deal? Try SONIC''s Premium Beef Chili Cheese Coney. A grilled beef hot dog topped with warm chili and melty cheddar cheese served in a soft, warm bakery bun.',2.4900000000000002131,1,1750104);
INSERT INTO menus_items VALUES(1443,'Classic Grilled Chicken Sandwich','100% all white meat grilled chicken breast topped with fresh lettuce, ripe tomatoes and light mayonnaise served on a warm Brioche bun.',5.8899999999999996802,1,1750104);
INSERT INTO menus_items VALUES(1444,'Classic Crispy Chicken Sandwich','Lightly seasoned and breaded 100% all white meat chicken breast topped with fresh lettuce, ripe tomatoes and mayonnaise served on a warm Brioche bun.',5.6900000000000003907,1,1750104);
INSERT INTO menus_items VALUES(1445,'Chicken Wrap','Grilled or crispy with ranch dressing, lettuce and Tomatoes.',5.4900000000000002131,1,1750104);
INSERT INTO menus_items VALUES(1446,'Crispy Tenders','All-white meat chicken tenders made with the perfect amount of crispiness to deliver the perfect bite! Now served with our NEW Signature Sauce!',4.8899999999999996802,1,1750104);
INSERT INTO menus_items VALUES(1447,'Jumbo Popcorn Chicken','Enjoy a crispy snack, or put together the perfect combo meal with our Jumbo Popcorn Chicken®, made with juicy all white meat. Choose from Buttermilk Ranch, Honey Mustard or Hickory BBQ dipping sauce.',4.9900000000000002131,1,1750104);
INSERT INTO menus_items VALUES(1448,'Sauced Popcorn Chicken','All-white meat chicken tenders made with the perfect amount of crispiness to deliver the perfect bite! Now served with our original popcorn chicken tossed in buffalo or honey barbecue.',4.9900000000000002131,1,1750104);
