INSERT INTO menus_items VALUES(1451,'Chili Cheese Tots','Crispy, golden brown tots smothered with warm, chili and cheese. Get ''em with your Order or on their own!',3.1899999999999999467,2,1750104);
INSERT INTO menus_items VALUES(1452,'Fries','Made from Whole Russet Potatoes, the new Natural-Cut, ‘skin-on’ fry brings more crispy crunch to deliver an all new taste sensation.',2.1899999999999999467,2,1750104);
INSERT INTO menus_items VALUES(1453,'Chili Cheese Fries','Crispy, golden brown sticks of potato goodness. Get ''em with your combo, or on their own smothered with warm, chili and cheese. But who are we to tell you how to eat?',3.1899999999999999467,2,1750104);
INSERT INTO menus_items VALUES(1454,'Mozzarella Sticks','Crispy on the outside, gooey on the inside. Melty, real mozzarella cheese, breaded and fried to perfection. Dunking in a side dipping cup of creamy marinara sauce is a must.',4.1900000000000003907,2,1750104);
INSERT INTO menus_items VALUES(1455,'Soft Pretzel Twist','A soft pretzel twisted into a tasty treat and served with Signature Cheese Sauce!',2.4900000000000002131,2,1750104);
INSERT INTO menus_items VALUES(1456,'Handmade Onion Rings','There''s really nothing better than SONIC''s crispy, handmade onion rings, We make them fresh every day !!!',2.6899999999999999467,2,1750104);
INSERT INTO menus_items VALUES(1457,'Ched ''R'' Peppers','It will be love at first bite. Spicy jalapenos filled with melty Cheddar cheese, breaded and fried to perfection. Cool it off with a side dipping cup of creamy Ranch dressing.',4.3899999999999996802,2,1750104);
INSERT INTO menus_items VALUES(1458,'Jumbo Popcorn Chicken','Enjoy a crispy snack, or put together the perfect combo meal with our Jumbo Popcorn Chicken®, made with juicy all white meat. Choose from Sonic Signature Sauce, Buttermilk Ranch, Honey Mustard or Hickory BBQ dipping sauce.',3.3900000000000001243,2,1750104);
INSERT INTO menus_items VALUES(1459,'Corn Dog','Simple food at its finest. A delicious hot dog surrounded in sweet corn batter and fried to a crispy golden brown. Try it with some mustard or ketchup if you want. It''s like hot dog utopia on a stick.',1.9899999999999999911,2,1750104);
INSERT INTO menus_items VALUES(1460,'Grilled Cheese','The delicious cheesy concoction all kids know and love. Two thick slices of Texas Toast with classic melted American cheese.',1.9899999999999999911,2,1750104);
INSERT INTO menus_items VALUES(1461,'Soft Drink','More options of cold, bubbly refreshments with your choice of flavor add-ins, all served over our famous SONIC ice.',1.9899999999999999911,3,1750104);
INSERT INTO menus_items VALUES(1462,'Fresh Brewed Unsweet Iced Tea','Freshly brewed iced tea. Perfect for any old cup holder. Try it with any of our five new flavor mix-ins, all sugar free and sweetened with Splenda®: peach, mango, raspberry, and blackberry. We’ve created your Ultimate Iced Tea Stop℠.',1.9899999999999999911,3,1750104);
INSERT INTO menus_items VALUES(1463,'Fresh Brewed Sweet Iced Tea','Freshly brewed iced tea. Perfect for any tea party. Try it with any of our five new flavor mix-ins, all sugar free and sweetened with Splenda®: peach, mango, raspberry, and blackberry. We’ve created your Ultimate Iced Tea Stop℠.',1.9899999999999999911,3,1750104);
