INSERT INTO menus_items VALUES(1789,'BBQ Chicken','Make the BBQ Chicken Footlong your game day go to. It’s mouthwatering, sweet and tangy and made with St. Louis style BBQ sauce—the perfect call for Footlong Season™. Tastes great with lettuce, tomatoes, red onion and pickles.',5.7900000000000000355,1,1224297);
INSERT INTO menus_items VALUES(1790,'Buffalo Chicken','Nothing says football season like Buffalo Chicken, and nothing says buffalo like Frank’s RedHot®. So this Footlong Season™, order up the new, spicy Buffalo Chicken Footlong made with everyone’s favorite sauce—Frank’s RedHot®. Try it with lettuce, tomatoes and cucumbers!',5.7900000000000000355,1,1224297);
INSERT INTO menus_items VALUES(1791,'Oven Roasted Chicken','The Oven Roasted Chicken sandwich is warm, with savory chicken on freshly baked bread with your choice of veggies. Oh, and it''s one of eight 6-inch Fresh Fit™ subs with two servings of crisp veggies on freshly baked bread for under 400 calories.',5.5899999999999998578,1,1224297);
INSERT INTO menus_items VALUES(1792,'American Club','The American Club is a delicious combo of turkey breast, Black Forest ham and Applewood Smoked bacon. We top it off with American cheese, lettuce, tomatoes, mayonnaise and fold it up in a tasty toasted Artisan flatbread.',6.0899999999999998578,1,1224297);
INSERT INTO menus_items VALUES(1793,'New Southwest Chicken Club','The new Southwest Chicken Club packs in chicken strips with Applewood Smoked bacon. We then add Pepper Jack cheese, tomatoes, lettuce, green peppers, red onions, Chipotle Southwest sauce, guacamole and toast it in our spicy jalapeno cheddar bread.',7.4900000000000002131,1,1224297);
INSERT INTO menus_items VALUES(1794,'BBQ Chicken','Make the BBQ Chicken Footlong your game day go to. It’s mouthwatering, sweet and tangy and made with St. Louis style BBQ sauce—the perfect call for Footlong Season™. Tastes great with lettuce, tomatoes, red onion and pickles.',5.7900000000000000355,2,1224297);
INSERT INTO menus_items VALUES(1795,'Buffalo Chicken','Nothing says football season like Buffalo Chicken, and nothing says buffalo like Frank’s RedHot®. So this Footlong Season™, order up the new, spicy Buffalo Chicken Footlong made with everyone’s favorite sauce—Frank’s RedHot®. Try it with lettuce, tomatoes and cucumbers!',5.7900000000000000355,2,1224297);
INSERT INTO menus_items VALUES(1796,'American Club','The American Club is a delicious combo of turkey breast, Black Forest ham and Applewood Smoked bacon. We top it off with American cheese, lettuce, tomatoes, mayonnaise and fold it up in a tasty toasted Artisan flatbread.',6.0899999999999998578,2,1224297);
INSERT INTO menus_items VALUES(1797,'New Southwest Chicken Club','The new Southwest Chicken Club packs in chicken strips with Applewood Smoked bacon. We then add Pepper Jack cheese, tomatoes, lettuce, green peppers, red onions, Chipotle Southwest sauce, guacamole and toast it in our spicy jalapeno cheddar bread.',7.4900000000000002131,2,1224297);
INSERT INTO menus_items VALUES(1798,'Black Forest Ham','Black Forest Ham sandwich is classic. Just add your own flavor. Oh, and it''s one of eight six-inch Fresh Fit™ subs with two servings of crisp veggies on freshly baked bread for under 400 calories.',4.6900000000000003907,2,1224297);
INSERT INTO menus_items VALUES(1799,'Chicken & Bacon Ranch Melt','The Chicken & Bacon Ranch Melt sandwich is packed with tender all-white meat chicken with seasoning and marinade, savory bacon, melty Monterey cheddar cheese…and toasted. Aw yeah.',5.8899999999999996802,2,1224297);
INSERT INTO menus_items VALUES(1800,'Tuna','You’ll love every bite of our classic tuna sandwich. Flaked tuna blended with creamy mayo then topped with your choice of crisp, fresh veggies. Served on our freshly baked bread.',5.3899999999999996802,2,1224297);
INSERT INTO menus_items VALUES(1801,'Cold Cut Combo','The Cold Cut Combo sandwich with ham, salami, and bologna (all turkey based) is a long-time Subway® favorite. Yeah. It''s that good.',4.6900000000000003907,2,1224297);
INSERT INTO menus_items VALUES(1802,'Italian B.M.T.®','The Italian B.M.T.® sandwich is filled with Genoa salami, spicy pepperoni, and Black Forest Ham. Big. Meaty. Tasty. Get it.',5.3899999999999996802,2,1224297);
INSERT INTO menus_items VALUES(1803,'Meatball Marinara','The Meatball Marinara sandwich is drenched in irresistible marinara sauce, sprinkled with Parmesan cheese, topped with whatever you want (no judgement) and perfectly toasted just for you.',4.6900000000000003907,2,1224297);
INSERT INTO menus_items VALUES(1804,'Oven Roasted Chicken','The Oven Roasted Chicken sandwich is warm, with savory chicken on freshly baked bread with your choice of veggies. Oh, and it''s one of eight 6-inch Fresh Fit™ subs with two servings of crisp veggies on freshly baked bread for under 400 calories.',5.5899999999999998578,2,1224297);
INSERT INTO menus_items VALUES(1805,'Spicy Italian','Our Spicy Italian sandwich is a combo of pepperoni and Genoa salami. Pile on cheese, crunchy veggies, and finish it with your favorite sauce. Or don''t. Your call.',4.6900000000000003907,2,1224297);
INSERT INTO menus_items VALUES(1806,'Steak & Cheese','Our Steak & Cheese sandwich is where warm, delicious steak gets topped with melty cheesiness. Get crazy with veggies and sauces to make it what you want.',5.8899999999999996802,2,1224297);
INSERT INTO menus_items VALUES(1807,'Sweet Onion Chicken Teriyaki','Our Sweet Onion Chicken Teriyaki sandwich is stuffed with teriyaki-glazed chicken strips topped with our own fat-free sweet onion sauce. All that, and it''s one of eight 6-inch Fresh Fit™ subs with two servings of crisp veggies on freshly baked bread for under 400 calories.',5.7900000000000000355,2,1224297);
INSERT INTO menus_items VALUES(1808,'Turkey Breast','If a classic is what you crave, then our oven roasted Turkey Breast is the sandwich for you. It’s full of flavor and packed with protein. Made-to-order with your choice of crisp veggies, served on our freshly baked bread.',5.3899999999999996802,2,1224297);
INSERT INTO menus_items VALUES(1809,'Veggie Delite®','The Veggie Delite® sandwich is crispy, crunchy, vegetarian perfection. Pile on the veggies any which way you want! It''s one of eight 6-inch Fresh Fit™ subs with two servings of crisp veggies on freshly baked bread for under 400 calories.',4.5899999999999998578,2,1224297);
INSERT INTO menus_items VALUES(1810,'Sunrise Subway Melt®','Rise and shine to a delightfully delicious breakfast of tender turkey, crispy bacon, Black Forest ham and fluffy egg white under a blanket of bubbly melted cheese. Try one today on hot toasted flatbread with your choice of tasty veggies.',3.4900000000000002131,2,1224297);
INSERT INTO menus_items VALUES(1811,'B.L.T.','The sub that proves great things come in threes. In this case, those three things happen to be crisp bacon, lettuce and juicy tomato. While there’s no scientific way of proving it, this B.L.T might be the most perfect sub in existence.',5.7900000000000000355,2,1224297);
INSERT INTO menus_items VALUES(1812,'Turkey Breast & Black Forest Ham','A sandwich so deliciously hearty, you won''t know you''re eating low fat. Enjoy the flavor of tender sliced turkey breast and Black Forest ham with your favorite veggies from juicy tomatoes to sweet red onions served on your favorite freshly baked bread.',5.3899999999999996802,2,1224297);
INSERT INTO menus_items VALUES(1813,'Pizza Sub','Hot outta the oven, it’s the Pizza Sub. Enjoy spicy pepperoni, piled high and layered with melt-a-licious cheese and our signature marinara sauce. Try it on freshly baked Italian Herb & Cheese bread today, because this May only, it joins our many $5 FOOTLONGS™.',4.6900000000000003907,2,1224297);
INSERT INTO menus_items VALUES(1814,'Veggie Patty','Delicious veggie patties served on fresh 9-Grain Wheat bread. Top it with fresh lettuce, baby spinach, tomatoes, cucumbers, green peppers and red onions.',5.7900000000000000355,2,1224297);
INSERT INTO menus_items VALUES(1815,'Turkey Italiano Melt','Tender turkey breast, oven-roasted to perfection. With genoa salami, spicy pepperoni, melty provolone and tangy NEW SUBWAY® Vinaigrette. All on freshly baked bread and with your favorite veggies to make it a sandwich like no other.',5.3899999999999996802,2,1224297);
INSERT INTO menus_items VALUES(1816,'Turkey & Bacon Guacamole','Tender Turkey Breast, crispy bacon and rich guacamole, made with a little kick of jalapenos, onion and garlic. Try it with fresh veggies like cucumbers, green peppers and red onions all on freshly toasted Italian Bread.',10.589999999999999858,2,1224297);
INSERT INTO menus_items VALUES(1817,'Chipotle Southwest Steak & Cheese','Saddle up with this delicious tomato basil wrap jam-packed with a double portion of steak and topped with your favorite Tex-Mex flavors like Monterey cheddar, guacamole, jalapenos, lettuce, tomatoes, red onion, green peppers and Chipotle Southwest sauce.',8.9900000000000002131,3,1224297);
INSERT INTO menus_items VALUES(1818,'Turkey, Bacon & Guacamole','The name says it all. A delicious tomato basil wrap filled with a double portion of our premium sliced turkey breast and smoky applewood bacon. And then topped with provolone cheese, guacamole, lettuce, tomatoes, red onions, and ranch sauce.',8.9900000000000002131,3,1224297);
INSERT INTO menus_items VALUES(1819,'Black Forest Ham','Black Forest Ham Signature Wrap is packed with a double portion of ham packed into a tomato basil wrap with lettuce, spinach, tomatoes, cucumbers, green peppers and red onions. Definitely delish.',8.9900000000000002131,3,1224297);
INSERT INTO menus_items VALUES(1820,'B.L.T.','Simply delicious! This classic on a Tomato Basil wrap, is filled with a double portion of our crispy bacon and finished off with lettuce, juicy tomatoes, and mayo.',8.9900000000000002131,3,1224297);
INSERT INTO menus_items VALUES(1821,'Cold Cut Combo','Can’t decide what kind of meat you want? Get three at once on a delicious tomato basil wrap. Stacked with a double portion of turkey-based meats including ham, salami, and bologna. Enjoy it with lettuce, tomatoes, cucumbers, green peppers, and red onions.',8.9900000000000002131,3,1224297);
INSERT INTO menus_items VALUES(1822,'Italian B.M.T. ®','The Italian B.M.T. ® Signature Wrap tastes great on a tomato basil wrap. It''s filled with a double portion of Genoa salami, spicy pepperoni, and Black Forest ham topped with lettuce, tomatoes, cucumbers, green peppers, and red onions. So tasty.',8.9900000000000002131,3,1224297);
INSERT INTO menus_items VALUES(1823,'Meatball Marinara','Our Meatball Marinara Signature Wrap is a double portion of Italian-style meatballs in irresistible marinara sauce, with Parmesan cheese, in a tomato basil wrap. Get yourself one.',8.9900000000000002131,3,1224297);
INSERT INTO menus_items VALUES(1824,'Oven Roasted Chicken','The Oven Roasted Chicken Signature Wrap is a fan favorite featuring a double portion of the oven roasted chicken you love, on a delicious spinach wrap. Top it with lettuce, tomatoes, cucumbers, spinach, crisp green peppers, and red onions.',8.5899999999999998578,3,1224297);
INSERT INTO menus_items VALUES(1825,'Spicy Italian','Feeling spicy? Grab a Spicy Italian Signature Wrap. It''s a double portion of spicy pepperoni and Genoa salami on a tomato basil wrap. Topped with lettuce, tomatoes, cucumbers, green peppers and red onions…it''s a pretty delicious meal.',8.9900000000000002131,3,1224297);
INSERT INTO menus_items VALUES(1826,'Steak & Cheese','Our Steak & Cheese Signature Wrap is a double portion of shaved steak, wrapped up with melty American cheese in a tomato basil wrap. Get crazy with veggies and sauces to make it what you want.',8.9900000000000002131,3,1224297);
INSERT INTO menus_items VALUES(1827,'Sweet Onion Chicken Teriyaki','The Sweet Onion Chicken Teriyaki Signature Wrap is a double portion of tender teriyaki-glazed, all-white meat chicken strips, raised without antibiotics, with seasoning and marinade topped with our fat-free sweet onion sauce. Wrap it up in a tomato basil wrap with lettuce, spinach, tomatoes, cucumbers, green peppers, and red onions. Get ready for a big bite of awesome.',8.9900000000000002131,3,1224297);
INSERT INTO menus_items VALUES(1828,'Tuna','Our tasty Tuna Signature Wrap is completely cravable. It has a double serving of flaked tuna mixed with mayo in a tomato basil wrap. Then it gets topped with any crunchy veggies you want.',8.9900000000000002131,3,1224297);
INSERT INTO menus_items VALUES(1829,'Turkey Breast','Our Turkey Breast Signature Wrap is a go-to. With a double portion of our premium sliced turkey in a spinach wrap. Made just for you with crunchy veggies and sauces.',8.9900000000000002131,3,1224297);
INSERT INTO menus_items VALUES(1830,'Turkey Breast & Black Forest Ham','Take a bite of this Spinach wrap filled with a double portion of our tender turkey breast and tasty Black Forest ham. Top it with lettuce, spinach, tomatoes, cucumbers, green peppers, and red onions. It’s simply delicious.',8.9900000000000002131,3,1224297);
INSERT INTO menus_items VALUES(1831,'Turkey Italiano Signature Wrap','The Turkey Italiano Signature Wrap is all about the meat. First, we load a double portion of tender turkey breast, Genoa salami and spicy pepperoni on a spinach wrap. Then we finish this Italian masterpiece with Provolone cheese, veggies, and a burst of zesty Subway® vinaigrette.',8.5899999999999998578,3,1224297);
INSERT INTO menus_items VALUES(1832,'Veggie Delite®','The Veggie Delite® Signature Wrap has a double portion of the fresh veggies you love. All wrapped in a flavorful spinach wrap with lettuce, tomatoes, spinach, green peppers, cucumbers, and red onions. It''s one bold, crunchy flavor combo.',8.9900000000000002131,3,1224297);
INSERT INTO menus_items VALUES(1833,'Veggie Patty','What’s better than a Spinach wrap filled with not one, but two of our flavor packed Veggie Patties, lettuce, spinach, tomatoes, cucumbers, green peppers, and red onions.',8.9900000000000002131,3,1224297);
INSERT INTO menus_items VALUES(1834,'Oven Roasted Chicken','The Oven Roasted Chicken sandwich is warm, with savory chicken on freshly baked bread with your choice of veggies. Oh, and it''s one of eight 6-inch Fresh Fit™ subs with two servings of crisp veggies on freshly baked bread for under 400 calories.',5.5899999999999998578,4,1224297);
INSERT INTO menus_items VALUES(1835,'Black Forest Ham','Black Forest Ham sandwich is classic. Just add your own flavor. Oh, and it''s one of eight six-inch Fresh Fit™ subs with two servings of crisp veggies on freshly baked bread for under 400 calories.',4.6900000000000003907,4,1224297);
INSERT INTO menus_items VALUES(1836,'Sweet Onion Chicken Teriyaki','Our Sweet Onion Chicken Teriyaki sandwich is stuffed with teriyaki-glazed chicken strips topped with our own fat-free sweet onion sauce. All that, and it''s one of eight 6-inch Fresh Fit™ subs with two servings of crisp veggies on freshly baked bread for under 400 calories.',5.7900000000000000355,4,1224297);
INSERT INTO menus_items VALUES(1837,'Turkey Breast','If a classic is what you crave, then our oven roasted Turkey Breast is the sandwich for you. It’s full of flavor and packed with protein. Made-to-order with your choice of crisp veggies, served on our freshly baked bread.',5.3899999999999996802,4,1224297);
INSERT INTO menus_items VALUES(1838,'Veggie Delite®','The Veggie Delite® sandwich is crispy, crunchy, vegetarian perfection. Pile on the veggies any which way you want! It''s one of eight 6-inch Fresh Fit™ subs with two servings of crisp veggies on freshly baked bread for under 400 calories.',4.5899999999999998578,4,1224297);
INSERT INTO menus_items VALUES(1839,'Bacon, Egg & Cheese','Start your day in a sizzlin'' way with bacon, egg, and melty cheese on freshly toasted flatbread (or whatever you like). Pile on your favorite veggies and sauce. Start the day right.',3.1899999999999999467,5,1224297);
INSERT INTO menus_items VALUES(1840,'Black Forest Ham, Egg & Cheese','Enjoy savory Black Forest ham, melted cheese, and egg - all on your favorite bread. Add your choice of veggies for a tasty way to start the day. Hello, delicious.',2.9900000000000002131,5,1224297);
INSERT INTO menus_items VALUES(1841,'Steak, Egg & Cheese','No matter what side of the bed you wake up on, you’ll love this. Yummy egg with tender and delicious steak covered in melty cheese. That''s one beautiful breakfast.',2.9900000000000002131,5,1224297);
INSERT INTO menus_items VALUES(1842,'Egg & Cheese','A classic for a reason. Our Egg and Cheese is simply delicious. Enjoy a fluffy egg omelet with melted cheese. Try it toasted - It''s unbeatable.',2.9900000000000002131,5,1224297);
INSERT INTO menus_items VALUES(1843,'Black Forest Ham','The Black Forest Ham salad is a flavorful way to enjoy a Subway® favorite. Sliced ham, lettuce, and a pile of your favorite veggies - all tossed with your choice of dressing.',7.3600000000000003197,6,1224297);
INSERT INTO menus_items VALUES(1844,'Chicken & Bacon Ranch','The Chicken & Bacon Ranch Melt salad has tender all-white meat chicken with seasoning and marinade, topped with Monterey cheddar cheese, and bacon. All on top of crunchy greens and your choice of dressing. Aw yeah.',8.4900000000000002131,6,1224297);
INSERT INTO menus_items VALUES(1845,'Cold Cut Combo','The Cold Cut Combo salad has ham, salami, and bologna (all turkey-based) tossed together with crisp lettuce and your favorite veggies. Mix it up with whatever dressing you love best.',7.3600000000000003197,6,1224297);
INSERT INTO menus_items VALUES(1846,'Italian B.M.T. ®','The Italian B.M.T. ® salad is the salad version of our popular sub. Crisp greens topped with Genoa salami, spicy pepperoni, and Black Forest ham. Meaty deliciousness, all in a salad.',7.9900000000000002131,6,1224297);
INSERT INTO menus_items VALUES(1847,'Meatball Marinara','The Meatball Marinara salad is the ultimate cravings crusher. Hot Italian-style meatballs in marinara sauce and a sprinkle of Parmesan cheese, all sitting on top of your favorite greens and veggies. Yes!',7.3600000000000003197,6,1224297);
INSERT INTO menus_items VALUES(1848,'Oven Roasted Chicken','The Oven Roasted Chicken salad has warm, savory chicken tossed together with crisp greens and any veggies you want. Your favorite sandwich, just in salad form.',7.5899999999999998578,6,1224297);
INSERT INTO menus_items VALUES(1849,'Spicy Italian','Our Spicy Italian salad is a combo of pepperoni and Genoa salami. Basically, the ideal Italian sub, but transformed into a salad. Genius, right?',7.3600000000000003197,6,1224297);
INSERT INTO menus_items VALUES(1850,'Steak & Cheese','The Steak & Cheese salad starts with crisp greens, but gets to the next level with warm, delicious steak topped with cheese. Dreams do come true.',8.4900000000000002131,6,1224297);
INSERT INTO menus_items VALUES(1851,'Sweet Onion Chicken Teriyaki','Enjoy our Sweet Onion Chicken Teriyaki flavors on a salad. Tender teriyaki-glazed chicken strips topped with fat-free sweet onion sauce over crisp greens and a generous pile of veggies. Flavor like whoa.',8.3900000000000005684,6,1224297);
INSERT INTO menus_items VALUES(1852,'Tuna','Our Tuna salad is simply delish. Flaked tuna mixed with mayo, riding high on top of a bed of crisp lettuce and veggies. Classic for a reason.',8.0700000000000002842,6,1224297);
INSERT INTO menus_items VALUES(1853,'Turkey Breast','The Turkey Breast salad is a go-to salad choice. Our premium sliced turkey breast, tossed together with lettuce, crunchy veggies and whatever dressing does it for you. Simply the best.',8.0899999999999998578,6,1224297);
INSERT INTO menus_items VALUES(1854,'Veggie Delite®','Enjoy the simpler things? The Veggie Delite® salad is simply delish. A pile of your favorite veggies, finished with the dressing of your choice. Crisp. Delicious. All for you.',5.9000000000000003552,6,1224297);
INSERT INTO menus_items VALUES(1855,'Turkey & Bacon Guacamole','This salad is a flavor feast. Tender turkey breast, bacon, and guacamole with crisp lettuce, spinach, ripe tomatoes, cucumbers, green peppers black olives and red onions. A salad that''s truly sumptuous.',8.9900000000000002131,6,1224297);
INSERT INTO menus_items VALUES(1856,'B.L.T.','Savory bacon. Crisp lettuce. Ripe tomatoes. All mixed with baby spinach, crunchy cucumbers, sweet green peppers, black olives, and zesty red onions.',8.3900000000000005684,6,1224297);
INSERT INTO menus_items VALUES(1857,'Turkey Breast & Ham Salad','Tender turkey breast and flavorful Black Forest Ham with lots of crisp lettuce, tender spinach, and many more of your favorite veggies.',8.0899999999999998578,6,1224297);
INSERT INTO menus_items VALUES(1858,'Pizza Sub','Spicy pepperoni, American cheese and mouthwatering marinara sauce over crisp lettuce, spinach, ripe tomatoes, cucumbers, green peppers, black olives and red onions.',7.3600000000000003197,6,1224297);
INSERT INTO menus_items VALUES(1859,'Veggie Patty','A delicious veggie patty mixed with lettuce, spinach, ripe tomatoes, cucumbers, green peppers, zesty red onions and black olives.',8.3900000000000005684,6,1224297);
INSERT INTO menus_items VALUES(1860,'Turkey Italiano Salad','Our turkey can now take you to real Italian flavor. Because it comes with spicy pepperoni, tempting salami and American cheese. It''s all mixed with lettuce, spinach, tomatoes, zesty red onions, olives and lots more. Drizzled with our signature Subway® Vinaigrette sauce.',8.0899999999999998578,6,1224297);
INSERT INTO menus_items VALUES(1861,'Black Forest Ham Mini for Kids','Every kid likes to ham it up once in a while. That’s why they’ll love the taste of our Black Forest ham and their favorite veggies on freshly baked bread. Apple slices and a choice of an ice-cold bottle of low fat milk or Honest Kids’® Fruit Punch make this better-for-you meal a star.',2.9900000000000002131,7,1224297);
INSERT INTO menus_items VALUES(1862,'Turkey Breast Mini for Kids','Kids love the taste of tender turkey breast, freshly baked bread and their favorite veggies. Apple slices and a choice of an ice-cold bottle of low fat milk or Honest Kids’® Fruit Punch make this better-for-you meal a star.',2.9900000000000002131,7,1224297);
INSERT INTO menus_items VALUES(1863,'Veggie Delite® Mini for Kids','Got a kid who loves vegetables above all else? Our Veggie Delite® kids meal piles all their favorites on freshly baked bread. Apple slices and a choice of an ice-cold bottle of low fat milk or Honest Kids’® Fruit Punch make this better-for-you meal a star.',2.9900000000000002131,7,1224297);
INSERT INTO menus_items VALUES(1864,'Musselman’s Apple Sauce','As delicious as our sandwiches are, they are even better when paired with the perfect side and drink or even adding a little something extra. With such a variety to choose from, there''s truly something for every taste.',1.7900000000000000355,8,1224297);
INSERT INTO menus_items VALUES(1865,'Chocolate Chip','Soft, buttery, chock full of chips. What more can we say? Enjoy.',0.79000000000000003552,8,1224297);
INSERT INTO menus_items VALUES(1866,'Oatmeal Raisin','Soft, chewy and delicious, our oatmeal raisin cookie is the perfect dessert, or snack.',0.79000000000000003552,8,1224297);
INSERT INTO menus_items VALUES(1867,'Raspberry Cheesecake','The flavor of sweet raspberry. The richness of cheesecake. Together in one awesome cookie creation.',0.79000000000000003552,8,1224297);
INSERT INTO menus_items VALUES(1868,'White Chip Macadamia Nut','Chunks of Macadamia nuts and white chips in a ridiculously delicious cookie.',0.79000000000000003552,8,1224297);
