INSERT INTO menus_items VALUES(3244,'1. Irish Car Bomb Brownie','Double thick, Guinness dark chocolate brownies topped with Irish cream cheesecake and ghiradelli milk chocolate chips. Absolute smooth, creamy, chocolate deliciousness.',9.9499999999999992894,1,1983326);
INSERT INTO menus_items VALUES(3245,'2. OMG Brownie','2 of our classic brownies in one. We start with our original chocolate chip cookie dough brownies and layer them on top of our chocolate peanut butter fusion brownies and then bake them together.',9.9499999999999992894,1,1983326);
INSERT INTO menus_items VALUES(3246,'3. The Annihilator Brownie','A veritable wall of amazing chocolate!!! We layered chocolate on chocolate on chocolate with zero restraint. 3 kinds of ghiradelli chocolate in a double thick chocolate brownie swirled throughout with dark chocolate syrup.',9.9499999999999992894,1,1983326);
INSERT INTO menus_items VALUES(3247,'4. Insanity Brownie','Ghiradelli milk chocolate melted down with real peanut butter and rice crispies, painted over toasted marshmallows, on top of a chewy gourmet brownie. Our all time, best seller.',9.9499999999999992894,1,1983326);
INSERT INTO menus_items VALUES(3248,'5. Buttery Nipple Blondies Brownie','New, for a limited time! double thick, ghirardelli white chocolate blondies, infused with real butterscotch schnapps, smothered with irish cream cheesecake and butterscotch chips. Smooth and creamy satisfaction.',9.9499999999999992894,1,1983326);
INSERT INTO menus_items VALUES(3249,'6. Cookies N Cream Brownie','3 of your favorites rolled into one crazy good, delicious gourmet brownie! We layer our family recipe cheesecake over gourmet brownie batter, then top it with chunks of double stuffed Oreos.',9.9499999999999992894,1,1983326);
INSERT INTO menus_items VALUES(3250,'7. S''moreos Brownie','Our ghiradelli chocolate smores brownie. Instead of graham crackers, we bake in chunks of double stuffed Oreos.',9.9499999999999992894,1,1983326);
INSERT INTO menus_items VALUES(3251,'8. The Diet Starts Tomorrow Brownie','Ghiradelli milk chocolate, liquified marshmallows, and cocoa roasted almonds folded into our delicious gourmet dark chocolate brownie batter.',9.9499999999999992894,1,1983326);
INSERT INTO menus_items VALUES(3252,'Dirty Java Brownie','This 6 pack of brownies contains the equivalent of four cups of coffee. It also has chunks of double stuffed Oreos and ghiradelli milk chocolate baked into them.',9.9499999999999992894,1,1983326);
INSERT INTO menus_items VALUES(3253,'Oreo Raspberry Avalanche Brownie','Chunks of double stuffed Oreos, swirled with raspberry, cascading down on a double thick, dark chocolate brownie. Tart, sweet, crunchy and decadent.',9.9499999999999992894,1,1983326);
