INSERT INTO menus_items VALUES(3557,'Dave''s Combo','A quarter-pound* of fresh beef, American cheese, crisp lettuce, tomato, pickle, ketchup, mayo, and onion on a toasted bun — just the way Dave intended.',7.7900000000000000355,1,1683775);
INSERT INTO menus_items VALUES(3558,'Baconator® Combo','A half-pound* of fresh beef, American cheese, 6 pieces of crispy Applewood smoked bacon, ketchup, and mayo. Carnivores rejoice!',8.8900000000000005684,1,1683775);
INSERT INTO menus_items VALUES(3559,'10 PC. Nuggets Combo','100% white-meat chicken breaded to crispy perfection and served with your choice of 6 dipping sauces including Buttermilk Ranch, Creamy Sriracha, BBQ, Sweet & Sour, Honey Mustard, or Side of S’Awesome®. They’re trending in our restaurants and Twitter feed alike.',5.9900000000000002131,1,1683775);
INSERT INTO menus_items VALUES(3560,'Classic Chicken Sandwich Combo','A juicy, lightly breaded crispy chicken breast with crunchy lettuce, tomato, mayo, and the perfect pickles, all on a toasted bun. It’s a flawless blend of nostalgia and excitement—kinda like your all-time favorite song, only better ‘cause you can eat it.',7.3899999999999996802,1,1683775);
INSERT INTO menus_items VALUES(3561,'Grilled Chicken Sandwich Combo','Herb-marinated grilled chicken breast topped with smoky honey mustard, crisp spring mix, and tomato, served on a warm toasted bun. See if it isn’t the best chicken sandwich you’ve ever had.',7.3899999999999996802,1,1683775);
INSERT INTO menus_items VALUES(3562,'Spicy Chicken Sandwich Combo','A juicy chicken breast marinated and breaded in our unique, fiery blend of peppers and spices to deliver more flavor inside and out, cooled down with crisp lettuce, tomato, and mayo. It’s the original spicy chicken sandwich, and the one you crave.',7.3899999999999996802,1,1683775);
INSERT INTO menus_items VALUES(3563,'Big Bacon Classic Combo','A quarter-pound* of fresh beef, Applewood smoked bacon, American cheese, crisp lettuce, tomato, pickle, ketchup, mayo, and onion on a toasted bun. It’s big. It’s classic. It’s got bacon.',7.6900000000000003907,1,1683775);
INSERT INTO menus_items VALUES(3564,'Pretzel Bacon Pub Cheeseburger','A quarter-pound* of fresh, never-frozen beef, warm beer cheese sauce, Applewood smoked bacon, smoky honey mustard, crispy fried onions, pickles, and a slice of muenster cheese all on an extra soft pretzel bun. Come for the Pretzel bun. Stay for everything else.',8.2899999999999991473,1,1683775);
INSERT INTO menus_items VALUES(3565,'Bacon Jalapeño Cheeseburger Combo','A quarter-pound* of fresh beef topped with pickled jalapeños, Applewood smoked bacon, American cheese, crispy fried onions, a savory cheese sauce and a smoky jalapeño sauce. It’s too hot to not.',7.5899999999999998578,1,1683775);
INSERT INTO menus_items VALUES(3566,'Asiago Ranch Classic Chicken Club Combo','A juicy, lightly breaded chicken breast taken over the top with thick Applewood smoked bacon, Asiago cheese, creamy ranch sauce, crisp lettuce, and tomato, all on a toasted bun. A club favorite that’s anything but boring.',8.3900000000000005684,1,1683775);
INSERT INTO menus_items VALUES(3567,'Pretzel Bacon Pub Classic Chicken','A juicy, lightly breaded chicken breast, warm beer cheese sauce, Applewood smoked bacon, smoky honey mustard, crispy fried onions, pickles, and a slice of muenster cheese all on an extra soft pretzel bun. More than just a pretzel bun even though it doesn’t have to be.',8.5899999999999998578,1,1683775);
INSERT INTO menus_items VALUES(3568,'Bacon Jalapeño Chicken Combo','A juicy chicken breast marinated and breaded in our unique, fiery blend of peppers and spices taken to the next level with pickled jalapeños, Applewood smoked bacon, American cheese, crispy fried onions, a savory cheese sauce and a smoky jalapeño sauce. Eat the heat.',8.2899999999999991473,1,1683775);
